  index[9] = integer_sequence(shared->offset_variable_U + 1, shared->dim_U);
  index[10] = integer_sequence(shared->offset_variable_LR + 1, shared->dim_LR);
  index[11] = integer_sequence(shared->offset_variable_LL + 1, shared->dim_LL);
